      procedure report_customer_all(year_in number, data_out out sys_refcursor);
      procedure report_growth(user_id number, start_date varchar, end_date varchar, data_out out sys_refcursor);
      TYPE report_type IS RECORD (
      month_report number,
      revenue number,
      revenue_vat number);
      TYPE report_tbl is table of report_type;
