/
--------------------------------------------------------
--  DDL for Package Body PKG_REPORT
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE PACKAGE BODY "DEVELOP"."PKG_REPORT" AS

  procedure report_customer(cus_in NVARCHAR2, year_in number, data_out out sys_refcursor) IS
  total_count number;
  c_id number;
  table_report report_tbl;
  cursor customer_list is
    select id from customers where is_deleted = 0 and id=cus_in;
  BEGIN
    table_report := report_tbl();
    table_report.extend(1000000);
    total_count := 1;
    open customer_list;
    loop
        fetch customer_list into c_id;
        EXIT WHEN customer_list%NOTFOUND;
        for data_contracts in (
                                select c.id, p.prices, p.prices_vat,
                                (COALESCE(p.time_used, 0) + COALESCE(p.promotion_time,0)) as time_used, 
                                to_number(to_char(c.start_date_package, 'MM')) as month_rp 
                                from contracts c 
                                join packages p on p.id = c.package_id 
                                where c.customer_id = cus_in 
                                and to_number(to_char(c.start_date_package, 'YYYY')) <= year_in 
                                and to_number(to_char(ADD_MONTHS(c.start_date_package, p.time_used + COALESCE(p.promotion_time, 0)), 'YYYY')) >= year_in
                            )
        loop
            for m in 1..12
            loop
                if data_contracts.month_rp <= m then
                    if data_contracts.month_rp + data_contracts.time_used < m then
                        table_report(total_count) := report_type(m, 0, 0);
                    else
                        table_report(total_count) := report_type(m, data_contracts.prices / data_contracts.time_used, data_contracts.prices_vat / data_contracts.time_used);
                    end if;
                else 
                    table_report(total_count) := report_type(m, 0, 0);
                end if;
                total_count := total_count + 1;
            end loop;
            
        end loop;
        
    end loop;
    close customer_list;
    open data_out for
        select month_report, round(sum(revenue),0) as revenue, round(sum(revenue_vat),0) as revenue_vat from table(table_report)
        where month_report is not null
        group by month_report
        order by month_report;
  END report_customer;
  
  procedure report_customer_all(year_in number, data_out out sys_refcursor) IS
  total_count number;
  table_report report_tbl;
  BEGIN
    table_report := report_tbl();
    table_report.extend(1000000);
    total_count := 1;
        for data_contracts in (
                                select c.id, p.prices, p.prices_vat,
                                (COALESCE(p.time_used, 0) + COALESCE(p.promotion_time,0)) as time_used, 
                                to_number(to_char(c.start_date_package, 'MM')) as month_rp 
                                from contracts c 
                                join packages p on p.id = c.package_id 
                                and to_number(to_char(c.start_date_package, 'YYYY')) <= year_in 
                                and to_number(to_char(ADD_MONTHS(c.start_date_package, p.time_used + COALESCE(p.promotion_time, 0)), 'YYYY')) >= year_in
                            )
        loop
            for m in 1..12
            loop
                if data_contracts.month_rp <= m then
                    if data_contracts.month_rp + data_contracts.time_used < m then
                        table_report(total_count) := report_type(m, 0, 0);
                    else
                        table_report(total_count) := report_type(m, data_contracts.prices / data_contracts.time_used, data_contracts.prices_vat / data_contracts.time_used);
                    end if;
                else 
                    table_report(total_count) := report_type(m, 0, 0);
                end if;
                total_count := total_count + 1;
            end loop;
            
        end loop;
    open data_out for
        select month_report, round(sum(revenue),0) as revenue, round(sum(revenue_vat),0) as revenue_vat from table(table_report)
        where month_report is not null
        group by month_report
        order by month_report;
  END report_customer_all;
  
  procedure report_growth(user_id number, start_date varchar, end_date varchar, data_out out sys_refcursor) AS
  BEGIN
    open data_out for
        select s.firstname,
        s.last_name,
        s.phone,
        sum(c.bill_prices) as package_price
        from contracts c
        join customers s on s.id = c.customer_id
        where (user_id = 0 or c.created_by = user_id)
        and c.created_at >= to_date(start_date, 'YYYY-MM-DD')
        and c.created_at <= to_date(end_date, 'YYYY-MM-DD')
        group by s.firstname, s.last_name, s.phone;
  END report_growth;

END PKG_REPORT;

